import React, { Component } from "react";
import "./Profile.css";
import axios from "axios";
import Navbar from "../Common/Navbar";
import { Container } from "react-bootstrap";
import image from "../user.png";

class Profile extends Component {
  state = {};

  fetchData = async () => {
    await axios
      .get("http://localhost:5000/user?c=" + document.cookie)
      // .then((res) => res.json())
      .then((res) => {
        this.setState({
          userDetails: res.data.userDetails,
          projects: res.data.projects,
        });
        console.log(this.state);
      });
  };

  componentDidMount() {
    this.fetchData();
  }

  render() {
    let userContent, linkedIn, github;
    if (this.state.userDetails) {
      comp = (
        <div>
          <h1>{this.state.userDetails.name}</h1>
          <h4>{this.state.userDetails.username}</h4>
        </div>
      );
      if (this.state.userDetails.linkedIn) {
        linkedIn = (
          <a href={this.state.userDetails.linkedIn} className="ic1">
            <i className="fab fa-linkedin"></i>
          </a>
        );
      }
      if (this.state.userDetails && this.state.userDetails.github) {
        github = (
          <a href={this.state.userDetails.github} className="ic1">
            <i className="fab fa-github"></i>
          </a>
        );
      }
    }
    return (
      <div>
        <Navbar />
        <Container>
          <div className="identity">
            <img className="userImage" src={image} />
            <div className="hello">
              {comp}
              {/* <h1>{this.state.userDetails.username}</h1> */}
              <h4>UserName</h4>
              <a href="" className="ic1">
                <i class="fab fa-linkedin"></i>
              </a>
              <a href="" className="ic2">
                <i class="fab fa-github"></i>
              </a>
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
export default Profile;
